function(e, prez) {
window.Jogo.tela = window.Jogo.Telas.JOGO;

if (!window.Nivel) {
    // Este objeto armazena algumas propriedades referentes ao
    // nível atual, bem como funções wrapper para facilitar
    // o código.
    window.Nivel = {
        // Função que retorna os botões atuais da cena.
        pegarBotoes() {
            const desktop = new Array(5)
                .fill(null)
                .map((_, i) => prez.object("btn_" + (i + 1)));
            const mobile = new Array(5)
                .fill(null)
                .map((_, i) => prez.object("btn_m_" + (i + 1)));
            
            return [...desktop, ...mobile];
        },
        
        // Função que retorna o timer da cena.
        pegarTimer() {
            return prez.object("tmr_relogio");
        },
        
        // Irá inicializar o jogo.
        inicializar() {
            console.log(
                "Round inicializado no nível " +
                prez.variable("NÍVEL")
            );
            this.novoRound();
        },
        
        desabilitarBotoes() {
            this.pegarBotoes()
                .forEach(o => o?.hide());
        },
        
        qttd: 5,
        
        habilitarBotoes() {
            this.pegarBotoes().forEach(
                o => {
                    if (o?.text().length) {
                        o?.show(AP.EffectType.FADE_IN, 300)
                    }
                }
            );
        },
        
        mostrarApenasCorreto(silabaAtual) {
            this.desabilitarBotoes();
            
            this.pegarBotoes()
                .filter(b => b.text() === silabaAtual)
                .forEach(b => b.show());
        },
        
        // Função que irá tocar o som da sílaba atual,
        // bloqueando os botões de serem pressionados, e os
        // liberando após o som ser tocado completamente.
        tocar() {
            if (
                window.Jogo.tela !== window.Jogo.Telas.JOGO
            ) {
                return false;
            }
            
            window.Jogo.tocar(
                prez.variable("SILABA"),
                () => window.Nivel.habilitarBotoes(),
                window.Jogo.Telas.JOGO
            );
            
            return true;
        },
        
        atribuirRespostasEm5(respostas) {
            const botoes = this.pegarBotoes();
            
            const desktop = botoes.slice(0, 5);
            const mobile = botoes.slice(5, 10);
            
            desktop.forEach((b, i) => b.text(respostas[i]));
            mobile.forEach((b, i) => b.text(respostas[i]));
        },
        
        atribuirRespostasEm3(respostas) {
            const botoes = this.pegarBotoes();
            
            botoes.forEach(b => b.text(''));
            
            const desktop = botoes.slice(1, 4);
            const mobile = [
                botoes[5],
                botoes[8],
                botoes[9]
            ];
            
            desktop.forEach((b, i) => b.text(respostas[i]));
            mobile.forEach((b, i) => b.text(respostas[i]));
        },
        
        // Função wrapper que irá utilizar a novoRound do
        // objeto do Jogo, ao mesmo tempo que atualiza a 
        // cena atual para modificar os botões.
        novoRound() {
            if (
                window.Jogo.tela !== window.Jogo.Telas.JOGO
            ) {
                return false;
            }
            
            const respostas = window.Jogo.novoRound();
            if (!respostas) return false;
            
            this.tocar();
            
            if (respostas.length === 5) {
                this.qttd = 5;
                this.atribuirRespostasEm5(respostas);
            } else {
                this.qttd = 3;
                this.atribuirRespostasEm3(respostas);
            }
            
            
            return true;
        },
        
        // Função que irá aumentar em 1 a rodada e a variável
        // de acerto caso o jogador tenha acertado.
        proximaRodada(acerto = false) {
            const rodada = prez.variable("RODADA");
            prez.variable("RODADA", rodada + 1);
            
            if (acerto) {
                const acertos = prez.variable("ACERTOS");
                prez.variable("ACERTOS", acertos + 1);
                
                const acertosNivel = prez.variable("ACERTOS_NIVEL");
                prez.variable("ACERTOS_NIVEL", acertosNivel + 1);
            }
        },
        
        // Função chamada pelos botões pressionados para
        // que possa ser verificado se o botao pressionado
        // tem a sílaba correta.
        verificar(botaoPressionado) {
            const silabaAtual = prez.variable("SILABA");
            this.desabilitarBotoes();
            
            let som;
            
            if (botaoPressionado.text() === silabaAtual) {
                som = "Correto";
                this.proximaRodada(true);
            } else {
                som = "Falha";
                this.proximaRodada(false);
            }
            
            this.mostrarApenasCorreto(silabaAtual);
            
            window.Jogo.tocar(som, () => {
                this.desabilitarBotoes();
                window.Nivel.novoRound();
            });
        }
    };
}

setTimeout(() => window.Nivel.inicializar(), 1000);
},
function(e, prez) {
window.Jogo.tela = window.Jogo.Telas.PROXIMO;
},
function(e, prez) {
window.parent.postMessage("fullscreen", "*");
}
